private boolean fetch() throws IOException {
  while (next == null && iterator.hasNext()) {
    LocatedFileStatus candidate = iterator.next();
    if (!tombstones.contains(candidate.getPath())) {
      next = candidate;
      return true;
    }
  }
  return false;
}
